import React from "react";
import { Col, Row, Container } from "../components/Grid";

const NewSale = () => {
  return (
    <Container fluid>
      New Sale Page
      <br />
      <a href="/completesale">Complete Sale</a>
    </Container>
  );
};

export default NewSale;
